// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

contract Registration{
    address private owner;
    constructor(){
        owner = msg.sender;
    }
    
    struct user{
        address payable user_addr;
        bool isAuth;
        string first_name;
        string user_type;
    }
    
    mapping(address => user) public User_Record;
    
    modifier checkAlreadyRegistered(address sender){
        require(sender != owner,"owner cannot register themself.");
        require(User_Record[sender].isAuth == false,"Already registered");
        _;
    }
    
    event Registered(address payable,string s);

    function getOwner()view public returns(address){
        return owner;
    }
    
    function register(address payable sender , string memory f_name,string memory u_type)public checkAlreadyRegistered(msg.sender) {
        require(sender == msg.sender,"Cannot Register someone else");
        User_Record[sender].first_name = f_name;
        User_Record[sender].user_type = u_type;
        User_Record[sender].user_addr = sender;
        User_Record[sender].isAuth = true;
        emit Registered(sender,"registration successful");
    }
}
